const initState = {
  projects: [
    { id: "1", title: "sand corp", content: "blah blah blah" },
    { id: "2", title: "rupayon", content: "blah blah blah" },
    { id: "3", title: "eastern housing", content: "blah blah blah" }
  ]
};

const projectReducer = (state = initState, action) => {
  return state;
};

export default projectReducer;
